import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from '../api/axiosInstance';
import BackToDashboard from './BackToDashboard';
import '../App.css';

interface MezzoBean {
  mezzoId: number;
  modello: string;
  targa: string;
  marca: string;
  colore: string;
  annoImmatricolazione: number;
  prezzo: number;
}

interface Tir {
  tirId: number;
  altezzaCassone: string;
  extMotoreEuroId: number;
  motoreEuro?: string;
  extTipoAlimentazioneId: number;
  alimentazione?: string;
  extTipoRimorchioId: number;
  rimorchio?: string;
  lunghezza: number;
  numeroAssi: number;
  portataMax: number;
  cilindrata: string;
  mezzoBean?: MezzoBean;
}

const TirDetail: React.FC = () => {
  const { tirId } = useParams<{ tirId: string }>();
  const [tir, setTir] = useState<Tir | null>(null);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
      return;
    }

    axios.get(`/automezzi/findTirById/${tirId}`, {
      headers: { Authorization: `Bearer ${token}` }
    })
      .then(res => {
        if (res.data.errorCode === 0) {
          setTir(res.data.tirBean);
        } else {
          console.warn('Errore:', res.data.errorMessage);
        }
      })
      .catch(err => {
        console.error('Errore nel caricamento tir:', err);
      });
  }, [tirId, navigate]);

  if (!tir) return <p>Caricamento...</p>;

  return (
    <div className="detail-container">
      <BackToDashboard />
      <h2>Dettaglio Tir</h2>
      <form className="form-container">
        <div className="form-group"><label>Marca:</label><input type="text" value={tir.mezzoBean?.marca || ''} readOnly /></div>
        <div className="form-group"><label>Modello:</label><input type="text" value={tir.mezzoBean?.modello || ''} readOnly /></div>
        <div className="form-group"><label>Targa:</label><input type="text" value={tir.mezzoBean?.targa || ''} readOnly /></div>
        <div className="form-group"><label>Colore:</label><input type="text" value={tir.mezzoBean?.colore || ''} readOnly /></div>
        <div className="form-group"><label>Anno Immatricolazione:</label><input type="number" value={tir.mezzoBean?.annoImmatricolazione || 0} readOnly /></div>
        <div className="form-group"><label>Prezzo:</label><input type="number" value={tir.mezzoBean?.prezzo || 0} readOnly /></div>
        <hr />
        <div className="form-group"><label>Numero Assi:</label><input type="number" value={tir.numeroAssi} readOnly /></div>
        <div className="form-group"><label>Portata Massima:</label><input type="number" value={tir.portataMax} readOnly /></div>
        <div className="form-group"><label>Cilindrata:</label><input type="text" value={tir.cilindrata} readOnly /></div>
        <div className="form-group"><label>Lunghezza (m):</label><input type="number" value={tir.lunghezza} readOnly /></div>
        <div className="form-group"><label>Altezza Cassone (m):</label><input type="text" value={tir.altezzaCassone} readOnly /></div>
        <div className="form-group"><label>Alimentazione:</label><input type="text" value={tir.alimentazione || ''} readOnly /></div>
        <div className="form-group"><label>Motore Euro:</label><input type="text" value={tir.motoreEuro || ''} readOnly /></div>
        <div className="form-group"><label>Tipo Rimorchio:</label><input type="text" value={tir.rimorchio || ''} readOnly /></div>
      </form>
    </div>
  );
};

export default TirDetail;
